import React, { useState } from "react";
import jwtDecode from "jwt-decode"; // Importar jwtDecode
import "./App.css";

function App() {
  const [showLogin, setShowLogin] = useState(false);
  const [showRegister, setShowRegister] = useState(false); // Estado para mostrar el formulario de registro
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [documentoPersona, setDocumentoPersona] = useState(""); // Documento de la persona asociada
  const [message, setMessage] = useState(null); // Mensaje de éxito o error

  // Manejo del registro
  const handleRegister = async () => {
    try {
      const response = await fetch("http://localhost:8080/api/auth/registrar", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          nombreUsuario: username,
          contrasena: password,
          persona: {
            documento: documentoPersona, // Asociar el documento de la persona
          },
        }),
      });

      if (response.ok) {
        const data = await response.text(); // El backend devuelve texto en este caso
        setMessage(data); // Mostrar el mensaje de éxito
        setShowRegister(false); // Ocultar el formulario de registro
        setShowLogin(true); // Mostrar el formulario de login
      } else {
        const errorData = await response.text();
        setMessage(errorData || "Error al registrar usuario.");
      }
    } catch (error) {
      setMessage("No se pudo conectar al servidor.");
    }
  };

  // Manejo del login (sin cambios)
  const handleLogin = async () => {
    try {
      const response = await fetch("http://localhost:8080/api/auth/login", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          nombreUsuario: username,
          contrasena: password,
        }),
      });

      const data = await response.json();
      if (response.ok) {
        localStorage.setItem("jwtToken", data.token);
        const decodedToken = jwtDecode(data.token);
        setMessage("Inicio de sesión exitoso. Bienvenido!");
        setShowLogin(false);
      } else {
        setMessage(data.message || "Error al iniciar sesión");
      }
    } catch (error) {
      setMessage("No se pudo conectar al servidor.");
    }
  };

  return (
    <div className="welcome-container">
      <div className="welcome-content">
        <h1 className="main-title">PROPSUITE</h1>
        <hr className="divider" />
        {message && <p className={message.includes("éxito") ? "success-message" : "error-message"}>{message}</p>}

        {!showLogin && !showRegister && (
          <>
            <h2 className="subtitle">¡Gestión de edificios al alcance de tus manos!</h2>
            <div className="button-container">
              <button className="custom-button" onClick={() => setShowLogin(true)}>
                Iniciar Sesión
              </button>
              <button className="custom-button" onClick={() => setShowRegister(true)}>
                Registrarse
              </button>
            </div>
          </>
        )}

        {showLogin && (
          <div className="form-horizontal">
            <div className="input-group">
              <label>Usuario</label>
              <input
                type="text"
                placeholder="Ingrese su usuario"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
              />
            </div>
            <div className="input-group">
              <label>Contraseña</label>
              <input
                type="password"
                placeholder="Ingrese su contraseña"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              />
            </div>
            <div className="button-container">
              <button className="custom-button" onClick={handleLogin}>
                Iniciar Sesión
              </button>
              <button className="custom-button" onClick={() => setShowLogin(false)}>
                Volver
              </button>
            </div>
          </div>
        )}

        {showRegister && (
          <div className="form-horizontal">
            <div className="input-group">
              <label>Usuario</label>
              <input
                type="text"
                placeholder="Ingrese su usuario"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
              />
            </div>
            <div className="input-group">
              <label>Contraseña</label>
              <input
                type="password"
                placeholder="Ingrese su contraseña"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              />
            </div>
            <div className="input-group">
              <label>Documento de Persona</label>
              <input
                type="text"
                placeholder="Ingrese el documento de la persona"
                value={documentoPersona}
                onChange={(e) => setDocumentoPersona(e.target.value)}
              />
            </div>
            <div className="button-container">
              <button className="custom-button" onClick={handleRegister}>
                Registrarse
              </button>
              <button className="custom-button" onClick={() => setShowRegister(false)}>
                Volver
              </button>
            </div>
          </div>
        )}
      </div>
    </div>
  );
}

export default App;
